import CustomButton from "../CustomButton"

const NavBar = () => {
  const options = [
    {value:'google', label:'Google'}
  ]
    return(
      <nav className="h-[84px] bg-[#FFFFFF] text-white flex items-center justify-between px-6 fixed w-[81%] left-[101px] top-0 z-50">
      <select className="border-2 border-[#4D4CAC] text-[#1C1D21] text-[16px] w-[10%]">

        {
          (options ||[]).map((option,index)=>{
            return(
              <option key={index} value={option.value}>{option.label}</option>
            )
          })
        }

      </select>
      <CustomButton className="">test</CustomButton>
      <div className="space-x-4">
        <button className="text-sm px-4 py-2 bg-gray-700 rounded">Home</button>
        <button className="text-sm px-4 py-2 bg-gray-700 rounded">Logout</button>
      </div>
    </nav>
    )
}

export default NavBar
